import React from 'react';

import Overlay from '../components/Overlay';

function Read() {
    return <div className='Main'>
        <Overlay />
        <div className='Content'>
            <div style={{justifyItems: "center", height: "100%"}} className='Column'>
                <p>1</p>
                <p>2</p>
            </div>
        </div>
    </div>
}

export default Read;
